INSERT INTO `v1_46bf941b862f6d3cbf571d9cd428ed69102d5964b70ca6f93162ca37edb3991c` VALUES (1, 0, 10, 1, 1, 0, 82, 0, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 82017, 11);
