INSERT INTO `v1_46bf941b862f6d3cbf571d9cd428ed69102d5964b70ca6f93162ca37edb3991c` VALUES (1, 0, 10, 1, 1, 0, 82, 0, "それでも……適性など踏み越えて、\n己の道を突き進むのが冒険者です。\n一度決めたことを、\n曲げるわけには参りません……！", 82021, 11);
